apakita ng isang post archive kapag binisita ang isang partikular na petsa (halimbawa, example.com/2023/).','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'Ito ay nagpapakita ng isang custom taxonomy archive. Tulad ng mga kategorya at mga tag, ang mga taxonomies ay may mga termino na ginagamit upang uriin ang mga bagay. Halimbawa: isang taxonomy na may pangalang "Art" ay maaaring magkaroon ng maraming mga termino, tulad ng "Modern" at "18th Century." Ang template na ito ay gagamitin bilang kapalit kapag hindi mahanap ang isang mas espesipikong template (halimbawa: Taxonomy: Art).','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'Nagpapakita ito kapag tinitingnan ng isang bisita ang isang hindi umiiral na pahina, tulad ng isang patay na link o isang mali na sinulat na URL.','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'Ito ay nagpapakita ng isang post tag archive. Ang template na ito ay gagamitin bilang kapalit kapag hindi mahanap ang isang mas espesipikong template (halimbawa: Tag: Pizza).','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'Ito ay nagpapakita ng mga indibidwal na post sa inyong website maliban na lamang kung mayroong inilalapat na pasadyang template sa post na iyon o mayroong dedikadong template na umiiral.','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'Ito ay nagpapakita ng lahat ng mga static na pahina maliban na lamang kung mayroong inilalapat na pasadya na template o mayroong dedikadong template na umiiral.','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'Ito ay nagpapakita ng anumang archive, kabilang ang mga post ng isang solong may-akda, kategorya, tag, taxonomy, custom post type, at petsa. Ang template na ito ay gagamitin bilang kapalit kapag hindi mahanap ang mga mas espesipikong template (halimbawa: Kategorya o Tag).','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'Ito ay nagpapakita ng isang post category archive. Ang template na ito ay gagamitin bilang kapalit kapag hindi mahanap ang isang mas espesipikong template (halimbawa: Category: Recipes).','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'Ito ay nagpapakita ng isang talaan ng mga nakaraang post ng isang solong may-akda. Ang template na ito ay gagamitin bilang kapalit kapag hindi mahanap ang isang mas espesipikong template (halimbawa: Author: Admin).','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'Ito ay nagpapakita ng anumang indibidwal na tala, tulad ng isang post o isang pahina. Ang template na ito ay gagamitin bilang kapalit kapag hindi mahanap ang isang mas espesipikong template (halimbawa: Single Post, Page, o Attachment).','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'Ipinapakita ang front page ng iyong site, nakatakda man itong magpakita ng mga pinakabagong post o isang static na page. Ang template ng Front Page ay nangunguna sa lahat ng mga template.','Used as a fallb