ize si %s sa site na ito. Gusto mo bang pumalit?','No changeset found to take over'=>'Walang nahanap na changeset na maaaring palitan','Security check failed.'=>'Nabigo ang pagsusuri sa seguridad.','Changeset is being edited by other user.'=>'In-eedit ng ibang user ang changeset.','menu locationsHere&#8217;s where this menu appears. If you would like to change that, pick another location.'=>'Dito lumalabas ang menu na ito. Kung gusto mong baguhin iyon, pumili ng ibang lokasyon.','menu locations(If you plan to use a menu <a href="%1$s" %2$s>widget%3$s</a>, skip this step.)'=>'(Kung plano mong gumamit ng isang menu <a href="%1$s" %2$s>widget%3$s</a>, laktawan ang hakbang na ito.)','menu locationsWhere do you want this menu to appear?'=>'Saan mo gustong lumabas ang menu na ito?','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'Gagawa ka ng isang menu, magtatalaga ito ng isang lokasyon, at magdaragdag ng mga item sa menu tulad ng mga link sa mga pahina at kategorya. Kung ang iyong tema ay may maraming mga lugar ng menu, maaaring kailanganin mong gumawa ng higit sa isa.','It does not look like your site has any menus yet. Want to build one? Click the button to start.'=>'Mukhang wala pang mga menu ang iyong site. Gusto mong gumawa ng isa? I-click ang button upang magsimula.','menu locationsView All Locations'=>'Tingnan ang Lahat ng Lokasyon','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'Habang nagpi-preview ng isang bagong tema, maaari mong ipagpatuloy ang pag-angkop ng mga bagay tulad ng mga widget at menu, at galugarin ang mga opsyong partikular sa tema.','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'Naghahanap ng tema? Maaari kang maghanap o mag-browse sa direktoryo ng tema ng WordPress.org, mag-install at mag-preview ng mga tema, at pagkatapos ay i-activate ang mga ito dito mismo.','menu locationsView Location'=>'Tignan ang lokasyon','No themes found. Try a different search.'=>'Walang nahanap na tema. Subukan ang ibang paghahanap.','Your theme can display menus in one location. Select which menu you would like to use.'=>'Maaaring magpakita ang iyong tema ng mga menu sa isang lokasyon. Piliin kung aling menu ang gusto mong gamitin.','Site Name: %s'=>'Pangalan ng Site: %s','%1$s &lsaquo; %2$s &#8212; WordPress'=>'%1$s &lsaquo; %2$s &#8212; WordPress','The query does not contain the correct number of placeholders (%1$d) for the number of arguments passed (%2$d).'=>'Ang query ay hindi naglalaman ng tamang bilang ng mga placeholder (%1$d) para sa bilang ng mga argumentong ipinasa (%2$d).','Unsupported value type (%s).'=>'Hindi suportadong uri ng halaga (%s).','Widgets need to be registered using %s, before they can be displayed.'=>'Kailangang irehistro ang mga widget gamit ang %s, bago sila maipakita.','Link to:'=>'I-link sa:','Gallery'=>'Galleriya','No images selected'=>'Walang mga larawang napili','Displays an image gallery.'=>'Nagpapakita ng isang gallery ng mga larawan.','Custom HTML Widget'=>'Custom HTML Widget','Use the Custom HTML widget to add arbitrary HTML code to your widget areas.'=>'Gamitin ang Custom HTML widget upang magdagdag ng arbitraryong HTML code sa iyong mga lugar ng widget.','Your email address has not been updated yet. Please check your inbox at %s for a confirmation email.'=>'Hindi pa na-update ang iyong email address. Pakisuri ang iyong inbox sa %s para sa isang email ng kumpirmasyon.','Howdy ###USERNAME###,

