###SITEURL###','<strong>Error:</strong> The email address is already used.'=>'<strong>Error:</strong> Ginagamit na ang email address.','&larr; Go to Categories'=>'&larr; Pumunta sa Mga Kategorya','&larr; Go to Link Categories'=>'&larr; Pumunta sa Mga Kategorya ng Link','Sorry, you cannot preview new themes when you have changes scheduled or saved as a draft. Please publish your changes, or wait until they publish to preview new themes.'=>'Paumanhin, hindi mo maaaring i-preview ang mga bagong tema kapag mayroon kang mga pagbabagong naka-iskedyul o naka-save bilang draft. Mangyaring i-publish ang iyong mga pagbabago, o maghintay hanggang ma-publish ang mga ito upang i-preview ang mga bagong tema.','Schedule your customization changes to publish ("go live") at a future date.'=>'I-iskedyul ang iyong mga pagbabago sa pag-customize upang ma-publish ("go live") sa isang hinaharap na petsa.','Homepage and posts page must be different.'=>'Dapat magkaiba ang homepage at pahina ng mga post.','There is %d error which must be fixed before you can save.'=>'Mayroong %d error na dapat ayusin bago ka makapag-save.' . "\0" . 'Mayroong %d (na) error na dapat ayusin bago ka makapag-save.','Lithuanian'=>'Lithuanian','Latvian'=>'Latvian','Korean'=>'Korean','Japanese'=>'Hapon','Italian'=>'Italyano','Irish'=>'Irish','Serbian'=>'Serbian','Russian'=>'Russian','Romanian'=>'Romanian','Portuguese'=>'Portuguese','Polish'=>'Polish','Persian'=>'Persian','Norwegian'=>'Norwegian','Maltese'=>'Maltese','Malay'=>'Malay','Macedonian'=>'Macedonian','Tagalog'=>'Taglog','Yiddish'=>'Yiddish','Welsh'=>'Welsh','Vietnamese'=>'Vietnamese','Ukrainian'=>'Ukrainian','Turkish'=>'Turkish','Thai'=>'Thai','Swedish'=>'Swedish','Swahili'=>'Swahili','Spanish'=>'Spanish','Slovenian'=>'Slovenian','There is a more recent autosave of your changes than the one you are previewing. <a href="%s">Restore the autosave</a>'=>'Mayroong mas kamakailang autosave ng iyong mga pagbabago kaysa sa iyong pini-preview. <a href="%s">Ibalik ang autosave</a>','Are you sure you want to discard your unpublished changes?'=>'Sigurado ka bang gusto mong itapon ang iyong mga hindi na-publish na pagbabago?','Reverting unpublished changes&hellip;'=>'Ibinabalik ang mga hindi na-publish na pagbabago&hellip;','Setting up your live preview. This may take a bit.'=>'Inihahanda ang iyong live preview. Maaaring tumagal ito nang kaunti.','Downloading your new theme&hellip;'=>'Dina-download ang iyong bagong tema&hellip;','Discard changes'=>'Itapon ang mga pagbabago','Please save your changes in order to share the preview.'=>'Paki-save ang iyong mga pagbabago upang maibahagi ang preview.','Updating'=>'Nag-a-update','Draft Saved'=>'Nai-save ang Draft','Activate &amp; Publish'=>'I-activate &amp; I-publish','Slovak'=>'Slovak','Filipino'=>'Filipino','French'=>'Pranses','English'=>'Ingles','Dutch'=>'Dutch','Estonian'=>'Estonian','Danish'=>'Danish','Czech'=>'Czech','Croatian'=>'Croatian','Chinese (Traditional)'=>'Instik (Tradisyonal)','Chinese'=>'Instik','Indonesian'=>'Indonesian','Icelandic'=>'Icelandic','Hungarian'=>'Hungarian','Hindi'=>'Hindi','Hebrew'=>'Hebrew','Haitian Creole'=>'Haitian Creole','Greek'=>'Griyego','German'=>'Griyego','Galician'=>'Galician','Chinese (Simplified)'=>'Instik (Pinasimple)','Catalan'=>'Catalan','Bulgarian'=>'Bulgarian','Belarusian'=>'Belarusian','Albanian'=>'Albanian','Afrikaans'=>'Afrikaans','Arabic'=>'Arabe','Live Broadcast'=>'Live na Pag-broadcast','Chapters'=>'Mga Kabanata','You are using a browser that does not have Flash player enabled or installed. Please turn on your Flash player plugin or download the latest version from https://get.adobe.com/flashplayer/'=>'Gumagamit ka ng isang browser na walang naka-enable o naka-install na Flash player. Mangyaring i-on ang iyong Flash player plugin o i-download ang pinakabagong bersyon mula sa https://get.adobe.com/flashplayer/','Method \'%s\' must be overridden.'=>'Dapat i-override ang paraan na \'%s\'.','Post custom field name%s:'=>'%s:','Author: %