###SITEURL###','Only UUID V4 is supported at this time.'=>'Tanging UUID V4 lamang ang suportado sa ngayon.','The Press This plugin is required.'=>'Kailangan ang Press This plugin.','%s themes'=>'%s (na) tema','Filter themes (%s)'=>'I-filter ang mga tema (%s)','Go to theme sources'=>'Pumunta sa mga pinagmulan ng tema','Search WordPress.org themes'=>'Maghanap ng mga tema sa WordPress.org','Install &amp; Preview'=>'I-install &amp; I-preview','Invalid URL.'=>'Hindi wastong URL.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'Oras na para magdagdag ng ilang mga link! I-click ang &#8220;%s&#8221; upang simulan ang paglalagay ng mga pahina, kategorya, at custom na mga link sa iyong menu. Magdagdag ng maraming bagay hangga\'t gusto mo.','Choose image'=>'Piliin ang imahe','Choose audio'=>'Piliin ang tunog','Change audio'=>'Palitan ang tunog','Select audio'=>'Pumili ng audio','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'I-click ang &#8220;Magdagdag ng Larawan&#8221; upang mag-upload ng isang file ng larawan mula sa iyong computer. Pinakamahusay na gumagana ang iyong tema sa isang larawan na may taas ng header na %s pixels &#8212; magagawa mong i-crop ang iyong larawan kapag na-upload mo na ito para sa isang perpektong akma.','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'I-click ang &#8220;Magdagdag ng Larawan&#8221; upang mag-upload ng isang file ng larawan mula sa iyong computer. Pinakamahusay na gumagana ang iyong tema sa isang larawan na may lapad ng header na %s pixels &#8212; magagawa mong i-crop ang iyong larawan kapag na-upload mo na ito para sa isang perpektong akma.','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'I-click ang &#8220;Magdagdag ng Larawan&#8221; upang mag-upload ng isang file ng larawan mula sa iyong computer. Pinakamahusay na gumagana ang iyong tema sa isang larawan na may laki ng header na %s pixels &#8212; magagawa mong i-crop ang iyong larawan kapag na-upload mo na ito para sa isang perpektong akma.','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'I-click ang &#8220;Magdagdag ng Larawan&#8221; upang mag-upload ng isang file ng larawan mula sa iyong computer. Pinakamahusay na gumagana ang iyong tema sa isang larawan na tumutugma sa laki ng iyong video &#8212; magagawa mong i-crop ang iyong larawan kapag na-upload mo na ito para sa isang perpektong akma.','Hour'=>'Oras','Time'=>'Oras','Day'=>'Araw','Month'=>'Buwan','Date'=>'Petsa','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'Meridian','Minute'=>'Minuto','Usage of user levels is deprecated. Use capabilities instead.'=>'Ang paggamit ng mga antas ng user ay hindi na ginagamit. Gamitin na lang ang mga kakayahan.','The theme defines itself as its parent theme. Please check the %s header.'=>'Tinutukoy ng tema ang sarili nito bilang kanyang parent theme. Pakisuri ang %s header.','Name for the Visual editor tabVisual'=>'Visual','Create New Menu'=>'Gumawa ng Bagong Menu','New Menu'=>'Bagong Menu','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Kung ang iyong tema ay may mga lugar ng widget, maaari ka ring magdagdag ng mga menu doon. Bisitahin ang <a href="%s">panel ng Mga Widget</a> at magdagdag ng isang &#8220;Navigation Menu widget&#8221; upang magpakita ng isang menu sa isang sidebar o footer.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Kung ang iyong tema ay may maraming mga menu, ang pagbibigay sa kanila ng malinaw na mga pangalan ay makakatulong sa iyo na pamahalaan ang mga ito.','Your theme can display menus in %s location.'=>'Maaaring magpakita ang iyong tema ng mga menu sa %s lokasyon.' . "\0" . 'Maaaring magpakita ang iyong tema ng mga menu sa %s na mga lokasyon.','Your theme can display menus in one location.'=>'Maaaring magpakita ang iyong tema ng mga menu sa isang lokasyon.','CSS code'=>'CSS code','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Awtomatikong binibigyang-diin ng edit field ang syntax ng code. Maaari mong i-disable ito sa iyong <a href="%1$s" %2$s>profile ng user%3$s</a> upang magtrabaho sa plain text mode.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'Mga gumagamit ng screen reader: kapag nasa forms mode, maaaring kailangan mong pindutin ang Esc key nang dalawang beses.','To move away from this area, press the Esc key followed by the Tab key.'=>'Upang umalis sa lugar na ito, pindutin ang Esc key na sinusundan ng Tab key.','In the editing area, the Tab key enters a tab character.'=>'Sa lugar ng pag-edit, ang Tab key ay naglalagay ng isang tab character.','When using a keyboard to navigate:'=>'Kapag gumagamit ng keyboard upang mag-navigate:','Add your own CSS code here to customize the appearance and layout of your site.'=>'Idagdag ang iyong sariling CSS code dito upang i-customize ang hitsura at layout ng iyong site.','Your homepage displays'=>'Ipinapakita ng iyong homepage','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Maaari mong piliin kung ano ang ipapakita sa homepage ng iyong site. Maaari itong mga post sa reverse chronological order (classic blog), o isang nakapirming/static na pahina. Upang magtakda ng isang static na homepage, kailangan mo munang gumawa ng dalawang Pahina. Ang isa ay magiging homepage, at ang isa pa ay kung saan ipapakita ang iyong mga post.','Homepage Settings'=>'Mga Setting ng Homepage','Copied'=>'Nakopya','Unable to trash changes.'=>'Hindi maaring matanggal ang mga pinalitan.','There was an authentication problem. Please reload and try again.'=>'Nagkaroon ng problema sa pagpapatunay. Paki-reload at subukang muli.','Changes have already been trashed.'=>'Ang mga pagbabago ay naibasura na.','You must supply a future date to schedule.'=>'Kailangan mong maglagay ng petsang hinaharap para makapag-schedule.','WordPress.org themes'=>'Mga tema sa WordPress.org','Installed themes'=>'Mga naka-install na tema','Publish Settings'=>'I-publish ang mga Setting','Preview Link'=>'Link ng Preview','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'Tingnan kung paano magiging hitsura ang mga pagbabago nang live sa iyong website, at ibahagi ang preview sa mga taong hindi ma-access ang Customizer.','Share Preview Link'=>'Ibahagi ang Link ng Preview','Changes trashed successfully.'=>'Matagumpay na na-trash ang mga pagbabago.','No changes saved yet, so there is nothing to trash.'=>'Wala pang nai-save na pagbabago, kaya walang maaaring i-trash.','Unable to save due to %s invalid setting.'=>'Hindi makapag-save dahil sa %s na hindi wastong setting.' . "\0" . 'Hindi makapag-save dahil sa %s na hindi wastong mga setting.','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'Na-publish na ang nakaraang hanay ng mga pagbabago. Mangyaring subukang i-save muli ang iyong kasalukuyang hanay ng mga pagbabago.','Edit User'=>'I-edit ang User','View User'=>'Tingnan ang User','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'Ang widget na ito ay maaring nagkaroon ng code na maaring gumana ng mas maayos sa bagong &#8220;Custom HTML&#8221; widget.  Kung hindi mo pa nasusubukan, maaring subukan ang widget na ito?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Code&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'Pasintabi, mukhang naglagay ka ng HTML sa &#8220;Visual&#8221; tab ng Text widget. Maari mong ilagay ang code mo sa &#8220;Text&#8221; tab na lang. Pwede mo ring subukan ang bagong &#8220;Custom HTML&#8221; widget!','Did you just paste HTML?'=>'Nag-paste ka ba ng HTML?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'Nabalitaan mo ba na may bagong &#8220;Custom HTML&#8221; widget ngayon? Makikita mo iyon sa pagtingin sa listahan ng mga magagamit na widgets sa screen na ito. Subukan mo iyon para makapaglagay ka ng custom code sa iyong site!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'Nabalitaan mo ba na mayroon &#8220;Custom HTML&#8221; widget ngayon? Makikita mo iyon sa pagpindot ng &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; at paghanap sa &#8220;HTML&#8221;. Subukan mo